load = {
    init: function (options) {
        if (options == undefined) {
            options = new Object();
            options.img = new Object();
        }
        if (!(document.getElementById('loadGlobal') != null && document.getElementById('loadGlobal') != undefined)) {
            div = document.createElement('div');
            div.id = "loadGlobal";
            div.style.position = "absolute";
            div.style.top = "0px";
            div.style.left = "0px";
            div.style.zIndex = 10000;
            div.style.width = "100%";
            div.style.height = "100%";
            div.style.opacity = '.5';
            div.style.filter = 'alpha(opacity = 50)';
            div.style.backgroundColor = "white";
            img = document.createElement('img');
            if(options.img.src == undefined){
                options.img.src = "data:image/gif;base64,";
            }
            img.src = options.img.src;
            img.width = options.img.w == undefined ? 100 : options.img.w;
            img.height = options.img.h == undefined ? 100 : options.img.h;
            wv = window.innerWidth;
            hv = window.innerHeight;
            div.appendChild(img);
            document.body.appendChild(div);
            img.style.marginLeft = ((wv - img.width) / 2) + "px";
            img.style.marginTop = ((hv - img.height) / 2) + "px";
        }
    },
    remove: function () {
        elemento = document.getElementById('loadGlobal');
        elemento.parentNode.removeChild(elemento);
    }
};